    false,nt"url": null,nt"notes": "This annual narrative report for Kenai
    NWR outlines Refuge accomplishments during the 1981 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. Land acquisition
    is covered. The report includes a planning section which discusses the master plan,
    public participation, and research and investigations. Refuge administration is
    outlined; information about personnel, youth programs, volunteer programs, funding,
    and safety is given. Habitat management is also covered; subjects include forests
    and wilderness areas. The wildlife section of the report discusses wildlife diversity,
    endangered and threatened species, waterfowl, marsh birds and waterbirds, shorebirds,
    raptors, game mammals, marine mammals, fisheries resources, wildlife propagation,
    and marking and bird banding. The public uses of the Refuge described in this report
    include outdoor classrooms, interpretive programs, hunting, fishing, trapping, wildlife
    observation, outdoor recreation, and law enforcement. The equipment and facilities
    section of the report provides information about new construction, rehabilitation,
    major maintenance, equipment replacement, communication systems, and energy conservation.
    Cooperative programs and items of interest are provided at the end.",nt"owner_org":
